import { Icon } from '@iconify/react';
import plusFill from '@iconify/icons-eva/plus-fill';
import { Link as RouterLink } from 'react-router-dom';
// material
import { Grid, Button, Container, Stack, Typography, TextField, Divider } from '@mui/material';
// components
import { Joystick } from 'react-joystick-component';

import SendIcon from '@mui/icons-material/Send';
import Page from '../components/Page';
import { BlogPostCard, BlogPostsSort, BlogPostsSearch } from '../components/_dashboard/blog';
import Image from './dummy.png'; // Import using relative path

//
import POSTS from '../_mocks_/blog';

export default function LiveCamera() {
  return (
    <Page title="Live View">
      <Container maxWidth="xl" overflow="hidden">
        <Stack direction="row" alignItems="center" justifyContent="space-between" mb={5}>
          <Typography variant="h4" gutterBottom style={{ color: '#66fcf1' }}>
            Live View
          </Typography>
        </Stack>
        <Grid container spacing={{ xs: 0 }} columns={{ xs: 8, sm: 8, md: 8, lg: 8 }}>
          <Grid style={{ top: '73.5%', left: '57.5%', position: 'absolute' }}>
            <TextField
              variant="filled"
              style={{
                maxWidth: '500px',
                minWidth: '450px'
              }}
              color="primary"
              textInputStyle={{ color: 'green' }}
              label="Command"
            />
          </Grid>
          <Grid style={{ top: '64%', left: '88.5%', position: 'absolute' }}>
            <Button variant="contained" endIcon={<SendIcon />} style={{ boxShadow: 'none' }}>
              Send Command
            </Button>
          </Grid>
          <Grid
            overflow="hidden"
            item
            xs={8}
            style={{
              maxWidth: '1778px',
              maxHeight: '1000px',
              minWidth: '1296px',
              minHeight: '729px',
              backgroundImage: `url(${Image})`
            }}
          >
            <Grid style={{ top: '525px', left: '3.6%', position: 'relative' }}>
              <Joystick size={150} baseColor="#45a29e" stickColor="#c5c6c7" top="500px" />
            </Grid>
          </Grid>
        </Grid>
      </Container>
    </Page>
  );
}
